#app4 .circle {
    width: 30vw;
    height: 30vw;
    border-radius: 50%;
    border: 2px solid yellowgreen;
    margin-top: 5vw;
    margin-left: 5vw;

}

@keyframes change {
    0% {
        background: gray;
    }

    50% {
        background: green;
    }

    100% {
        background: red;
    }
}

#app4 .circle.active {
    animation: change 2s infinite alternate linear;
}
